column2:
Родился 16 октября 1974 года в с. Кызыл-Сенир Сузакского района Жалал-Абадской области.
Образование высшее. В 1996 году окончил Кыргызский государственный институт физический культуры и спорта по специальности “Преподаватель физкультуры”, в 2010 году – Кыргызская государственная юридическая академия по специальности “Юриспруденция”.
Трудовую деятельность начал в 1998 году преподавателем физкультуры в филиале Кыргызского государственного института физический культуры и спорта Жалал-Абадской области.
В 2000-2007 годы – индивидуальный предприниматель;
С 2007 по 2010 год – председатель общественного фонда “Элдик чындык”;
В 2010-2011 годы – представитель Торгово-промышленной палаты Кыргызской Республики в КНР;
В 2011-2012 годы – советник Генерального директора Госдирекции по восстановлению и развитию городов Ош и Жалал-Абад.
4 октября 2015 года избран депутатом Жогорку Кенеша Кыргызской Республики VI созыва от партии “Өнүгүү-Прогресс”.
С ноября 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по Сузакскому одномандатному округу № 13.
Женат, четверо детей.

Родился 11 февраля 1976 года в с. Масы Ноокенского района Жалал-Абадской области.
Образование высшее. В 2003 году окончил Жалал-Абадский коммерческий институт по специальности «Менеджер организации».
Трудовую деятельность начал в 1999 году инспектором отдела внешнего контроля налоговой инспекции Ноокенского района Жалал-Абадской области.
2000-2005гг. - главный бухгалтер кредитного союза «Айкыз» Ноокенского района;
2005-2006гг. - председатель крестьянского хозяйства «Токтомурад» Ноокенского района;
2006-2013гг. - эксперт по поддержке и развитию общин по Ноокенскому району и городам Майлуу - Суу и Таш - Кумыр, Агентство развития и инвестирования сообществ Кыргызской Республики (АРИС);
2013-2015г. - координатор Южного регионального представительства Агентства развития и инвестирования сообществ Кыргызской Республики (АРИС).    
Общественная деятельность:        
С 2004 по 2005гг. - депутат Ноокенского районного кенеша и Масынского местного кенеша, являлся постоянным членом комиссии сельского хозяйства, промышленности, транспорта и телекоммуникации;       
2008-2012гг. - депутат Масынского местного кенеша, являлся председателем комиссии «Бюджет и экономика»;  
2012-2016гг. - депутат Масынского местного кенеша, заместитель председателя Масынского айыльного кенеша.
31 марта 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VI созыва от политической партии «Онугуу-Прогресс».
C марта 2022 года -  депутат Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ата-Журт Кыргызстан».
Женат, отец 5 детей.

Родилась 13 августа 1965 года в селе Кош –Добо, Аксыйского района.
Образование высшее. В 1992 году окончила Кыргызский Государственный Университет факультет экономики по специальности «экономист».
С 1982 года - заведующая сектором учета Джанги-Джолский РК ЛКСМ Киргизии;
с 1984 по1989 год - кладовщик в Караванском РайПО;
с 1989 по1994 год - кассир, главный экономист в АТП «Жаны-Жол»;
с 1995 года - ведущий специалист по бухгалтерскому учету в Фонде Госимущества Кыргызстана;
с 1995 по1997 год - главный специалист в Таш-Кумырском филиале АКБ «Кыргызстан»;
с1999 по 2000 год - директор в Каныш-Кийском филиале АО «РСК Банк»;
с 2006 по 2007 год - заведующая сберегательной кассы ОАО «Кыргызпромстройбанк» в Ала-Букинском районе;
с 2007 по 2010 год - управляющая сберегательной кассы ОАО «Аманбанк» в Оше.
В 2021 году была избрана депутатом Жогорку Кенеша Кыргызской Республики VII созыва по списку от политической партии «Ишеним».
Замужем, мать четверых детей.

Родился 21 апреля 1991 года в селе Кожо-Арык Ноокатского района Ошской области.
Имеет высшее образование. В 2008 году поступил в Ошский государственный Юридический Институт (ОшГЮИ), факультет «Управления и права».
2014-2015 годы — начальник участка ОсОО "Дастан Курулуш";
с июня по ноябрь 2015 года — технический директор ОсОО "Дастан Курулуш";
2015-2016 годы — генеральный директор ОсОО "Дастан Курулуш";
2016-2017 годы — учредитель, генеральный директор ОсОО "Тагай Ата";
2017-2018 годы — генеральный директор ОсОО "Эмаком";
2018-2021 годы — президент холдинга ОсОО "Эмаком Холдинг";
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ишеним».
Женат, отец 3 детей.

Родился 22 декабря 1988 года в городе Токмок Чуйской области. Имеет высшее образование.
В 2005-2011 годы обучался в  Кыргызско-Российском Славянском университете имени Б. Ельцина по специальности «Конституционное право».
В 2008-2009 годы прошел курсы по углубленному изучению английского языка (Сан-Франциско, США).
В 2011-2014 годы обучался в Академии государственного управления при Президенте Кыргызской Республики по специальности «Менеджмент в государственном и местном самоуправлении».
В 2021 году поступил в аспирантуру в Кыргызско-Российский Славянский университет имени Б. Ельцина.
Трудовая деятельность:
С 2015-2018 годы – коммерческий директор ОсОО «Восход и Ко»;
С 2016-2021 годы – депутат Бишкекского городского кенеша;
В 2018  году –  заместитель председателя постоянной комиссии Бишкекского городского кенеша по бюджету и финансам;
2018-2021 годы – председатель Бишкекского городского кенеша;
29 декабря 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по Ленинскому одномандатному округу № 26.
Женат, воспитывает троих детей.

Родился 13 июля 1984 года в Нарынской области.
Имеет два высших образования.
В 2007 году окончил инженерный факультет Жалал-Абадского государственного университета по специальности "Инженер-энергетик";
В 2012 году окончил магистратуру в Кыргызской государственной юридической академии по направлению "Юриспруденция";
С 2004 года по 2021 год занимался частным предпринимательством;
В 2021 году избран депутатом Жогорку Кенеша Кыргызской Республики 7 созыва по Нарынскому избирательному округу;
Женат, отец шестерых детей.

Родилась 19 июля 1977 года в поселке Кировка Кировского района Таласской области. В 1994 году успешно окончила школу. В 2000 году окончила Кыргызский Государственный Национальный Университет по направлению "Финансы и кредит", специальность «Банковское дело».
В 2013 году на базе высшего первого образования Кыргызкого национального университета им. Ж. Баласагына присвоена квалификация «юрист», по специальности «юриспруденция».
Трудовая деятельность:
1998-2005 г.г.- главный бухгалтер и специалист по кадрам ОКХ «Тынай – Ата»;
2005-2009 г.г.- бухгалтер БУГХ «Бишкекгаз»;
2009-2011 г.г.- специалист, ведущий специалист, главный бухгалтер отдела учета АУР ОАО «Азия Универсал Банк»;
2011 г. - главный специалист управления бухгалтерского учета и отчетности ОАО «ФинансКредитБанк КАБ»;
2011-2014 г.г. - главный бухгалтер ОсОО «АзияТрансИнвест»;
2014-2019 г.г. - эксперт Центра судебного представительства Правительства Кыргызской Республики;
2019 г. – по ноябрь 2021 г. заместитель директора Центра судебного представительства Правительства Кыргызской Республики;
С ноября 2021 года – депутат Жогорку Кенеша Кыргызской Республики VII созыва.
Замужем, мать пятерых детей.

Родился 27 мая 1958 года в селе Караван Жаӊы-Ноокатского района Ошской области.
В 1975 году окончил среднюю школу имени Жоомарта Боконбаева в городе Баткен.
Образование высшее:
В 1983 году окончил Рижский Краснознаменный институт инженеров гражданской авиации имени Ленинского комсомола по специальности "Эксплуатация летательных аппаратов и двигателей", присвоено квалификация инженер-механик;
В 1988 году окончил высшие курсы КГБ СССР в г.Киеве;
1999-2002 годы окончил Кыргызский Государственный Национальный университет по специальности «Финансы и кредит»;
Трудовая деятельность: 
1983-1987 годы – инженер технического отдела Фрунзенского объединенного отряда аэропорта «Манас»;
1987-1993 годы – служба в органах национальной безопасности кыргызской Республики, г.Бишкек - оперуполномоченный, старший оперуполномоченный, начальник отдела;
1993-1994 годы – Национальная авиакомпания «Кыргызстан аба жолдору», помощник Президента, начальник отдела авиационной безопасности;
1995-1997-годы – Акционерно-коммерческий банк «Кыргыз Жери», советник Председателя;
1997-1998 годы – Национальная авиакомпания «Кыргызстан аба жолдору», помощник Президента по авиационной безопасности;
21.03.2000-2.10.2000 годы – советник, пресс-секретарь главы государственной администрации Баткенской области – губернатора;
2000-2001 годы – начальник отдела промышленности, строительства и коммуникации аппарата государственной администрации Баткенской области;
2001-2004 годы – генеральный директор аэропорта «Баткен» г. Баткен;
2004-2004 годы – заместитель начальника финансово-экономического отдела Баткенского управления водного хозяйства;
2005-2008 годы – глава государственной администрации Баткенской области - губернатор;
2008-2010 годы – советник Президента Кыргызской Республики;
В 2010 году – заместитель главы государственной администрации Баткенской области-губернатора;
2010-2011 годы – глава государственной администрации Баткенской области-губернатор;
В 2011 году – советник Президента Кыргызской Республики;
В 2021 году избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ыйман Нуру».
Женат, имеет 3 детей.

Родился 24 августа 1967 года в селе Дон Алыш Сокулукского района Чуйской области.
В 1987 году успешно окончил Фрунзенский совхозтехникум по специальности «Зоотехник».
В 2005 году окончил Кыргызский национальный университет им. Ж. Баласагына по  специальности «Экономист».
В1987-1990 гг. - служба в Советском военно-морском флоте, имеет звание «Главно-корабельный старшина».
Женат, воспитывает 4 детей.
Трудовая деятельность:

1990 год – фермерский учётчик в Колхозе им. Ленина;
1991-1993 г.г.- зоотехник при Министерстве сельского хозяйства Кыргызской Республики;
1993-1996 г.г.- заведующий главы сельско-хозяйственного кооператива «Шоро», далее заведующий складом Кыргызпотребсоюза;
1997-1998 г.г. – снабженец фирмы «Бек-Констракшн»;
1999-2001 г.г. – «Свободная экономическая зона» (СЭЗ) Бишкек: контролёр, старший контролёр, руководитель контроля дисциплинарного совета, руководитель отдела подсобного хозяйства, руководитель отдела строительства, позже начальник отдела строительства и механизации;
2001-2011г.г. – директор Общества с ограниченной ответственностью СЭЗ Бишкек («Арпа», «СЭЗ курулуш», «Баден-Сервис»). Под руководством  строительной фирмы «Баден-Сервис» были построены центр отдыха «Ак-Марал» на Иссык-Куле, казарма и столовая американской авиабазы «Ганси», здание ЗАО «Банк-Азия». В 2000 году был удостоен лицензии I-й степени Государственного строительства Кыргызской Республики.
Был избран депутатом Ала-Арчинского Местного Кенеша Аламудунского района Чуйской области, затем депутатом Военно-Антоновского Местного Кенеша Сокулукского района;
2011-2012 г.г. – заместитель гендиректора ОсОО «СЭЗ Бишкек»;
24.12.2012-02.2017 г.г. – аким Сокулукского района;
13.11.2020-22.05.2021 г.г.- аким Сокулукского района;
С 2021 года с мая месяца по октябрь месяцы работал  акимом Кара-Кулжинского района.
С ноября 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва.

Кадырбеков Нуржигит родился 31 марта 1977 года в Кара-Кульджинском районе Ошской области.
В 1994 году окончил с золотой медалью среднюю школу имени Алмаза Субанова в селе 1-Май Кара-Кульджинского района. В 1999 году окончил с отличием юридический факультет Ошского Государственного Университета. 
В 2009 году окончил магистратуру в Университете КОБЭ в Японии. Присвоена степень магистра политологии.
Трудовая деятельность:
1995-2005 — преподавал культуру речи на юридическом факультете и в отделении журналистики Ошского государственного университета;
2001-2002 — ведущий специалист управления Министерства юстиции КР в Ошской области;
2002-2003 — юрист в Ошском государственном университете;
2004-2005 — советник ректора ОшГУ по правовым вопросам и связям с общественностью;
2005-2008 — специалист первой категории в информационной службе Министерства иностранных дел КР;
с августа по ноябрь 2005-го — руководитель информационной службы МИД;
2005-2007 — пресс-секретарь МИД;
2009-2010 — эксперт коммуникационной группы службы экспертно-аналитического обеспечения при секретариате президента КР;
с февраля по апрель 2010-го — эксперт группы информационной поддержки информационной службы секретариата президента;
с апреля по август 2011-го — исполняющий обязанности директора Делового совета Кыргызстана;
2012-2013 — начальник управления информации, печати и культуры Министерства иностранных дел КР;
2013-2015 — заместитель руководителя отдела этнической, религиозной политики и взаимодействия с гражданским обществом аппарата президента КР;
2015-2019 — председатель правления общественного фонда развития духовной культуры "Ыйман";
2019-2020 — заместитель министра культуры, информации и туризма КР.
В октябре 2020 года был назначен министром культуры, но освобожден от должности в феврале 2021 года с приходом нового состава Правительства.
14 октября 2020 года назначен министром культуры, информации и туризма КР.
С ноября 2021 года является депутатом Жогорку Кеӊеша Кыргызской Республики.
Является президентом Национальной Федерации Сётокан карате.
Женат, отец трех детей.

Жамгырчиев Эмил Эрикович родился 12 марта 1982 года в городе Фрунзе.
Имеет высшее юридическое и высшее экономическое образование. В 2006 году с отличием окончил Академию МВД им. генерал-майора Э.Алиева по специальности “Юриспруденция”.
В 2003 году углубленно изучал английский язык в “Princess college” (Лондон, Великобритания).
В 2012-2016 годы обучался на экономическом факультете в Кыргызском Национальном Аграрном Университете им.Скрябина по специальности “Финансы и кредит”.
В 2020 году поступил на магистратуру в Кыргызский Национальный Аграрный Университет им.Скрябина по специальности “Экология и природопользование”. 
 
Трудовая деятельность:
2007-2010 гг.  - Следственное Управление Государственной службы финансовой полиции Кыргызской Республики, следователь;
2010-2011 гг. - Главное Управление внутренних дел Чуйской области, начальник отдела по борьбе с экономической преступностью и коррупцией;
02.2011-09.2011 гг. - Главное Управление внутренних дел Чуйской области, начальник отдела по борьбе с организованной преступностью и коррупцией;
2011-2012 гг. - Аппарат Президента Кыргызской Республики, заместитель заведующего отделом по работе с обращениями граждан;
07.2012-11.2012 гг. - Аппарат Правительства Кыргызской Республики, инспектор отдела обороны, правопорядка и чрезвычайных ситуаций;
2014-2015 гг. - Управление Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики по Чуйской и Таласской областям, и.о. начальника Управления;
2015-2016 гг. - Управление Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики по Чуйской области, заместитель начальника Управления;
2016-2018 гг. - Управление Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики по г.Бишкек, заместитель начальника Управления – начальник отдела по экономическим преступлениям;
2018-10.2020 гг. - Заместитель председателя Государственной службы по борьбе с экономическими преступлениями при Правительстве Кыргызской Республики;
В феврале 2022 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Альянс».
Женат, воспитывает троих детей.

Родилась 13 апреля 1965 года в г. Фрунзе.
В 1987 году с отличием окончила юридический факультет Кыргызского государственного университета имени 50-летия СССР (КГУ) по специальности «Правоведение».
Трудовая деятельность:
С августа по октябрь 1987 года - Министерство юстиции СССР, государственный нотариус 1-й государственной нотариальной конторы, г. Фрунзе;
С октября 1987 г. переведена в органы Прокуратуры Киргизской СССР, Прокуратура Ленинского района, г. Фрунзе, стажер, помощник, старший помощника прокурора района;
1992-1998 г.г.- Генеральная прокуратура Кыргызской Республики, Прокуратура г.Бишкек - старший помощник прокурора города, начальник отдела, прокурор следственного отдела;
1998-2003 г.г.- Прокуратура г. Бишкек, начальник отдела по надзору за расследованием экономических преступлений и коррупции;
2003-2007 г.г.- Генеральная  прокуратура Кыргызской Республики, начальник общего отдела;
2007-2008 г.г.- первый заместитель прокурора г. Бишкек;
2008-2011 г.г.- прокурор Ленинского района г. Бишкек;
С 2003 по 2011 г.г. – являлась  членом экспертной группы по разработке законопроектов, включая работу по внесению  изменений и дополнений в УК КР,УПК КР, и.д. кодексы КР; 
В 2012 г. была членом экспертной рабочей группы по госпрограмме «Развитие судебной системы в КР в 2013-2017года».
С ноября 2021 года избрана депутатом Жогорку Кенеша Кыргызской Республики VII созыва от партии «Бутун Кыргызстан».
Классный чин - Советник юстиции 1 класса.
Мать двоих детей.

Родился 24 марта 1981 года в г.Бишкек.
Образование высшее. 
В 2002 году окончил Кыргызский технический университет им. И.Раззакова, факультет Информационных технологий по специальности «Автоматизация и управление» - степень бакалавра.
В 2003 году Кыргызский технический университет им. И.Раззакова, факультет Информационных технологий по специальности «Автоматизация и управление в технических системах» высшее образование (магистратура).
В 2011 году Кыргызский экономический университет, по специальности «Финансы и кредит».
Трудовая деятельность:
2003-2004 гг. - Социальный фонд КР, ведущий специалист отдела программного обеспечения;
С марта по ноябрь 2004 года - Социальный фонд КР, главный специалист отдела программного обеспечения;
2004-2006 гг. - Социальный фонд КР, заместитель начальника управления и начальник отдела программного обеспечения;
С апреля по декабрь 2006 года - Социальный фонд КР, начальник управления информационных систем;
2006-2008 гг. - Министерство экономики и финансов КР, заведующий отделом информационного обеспечения;
С мая по декабрь 2008 года - Министерство финансов КР, помощник министра;
2007-2008 гг. - Министерство экономического развития и торговли КР, помощник министра;
2008-2009 гг. - Министерство экономического развития и торговли КР, советник министра;
С марта по ноябрь 2009 года - Министерство экономического развития и торговли КР, Начальник Главного управления организационно-кадровой работы и финансового обеспечения;
2009-2010 гг. - Аппарат Правительства КР, советник первого вице-премьер-министра КР;
С августа по ноябрь 2010 года - Политическая партия «Ар-Намыс», руководитель аппарата;
2010-2011 гг. - Жогорку Кенеш КР, заведующий отделом депутатской фракции «Ар-Намыс»;
2011-2012 гг. - Министерство экономического регулирования КР, и.о. статс-секретаря;
С января по сентябрь 2012 года - Аппарат Правительства КР, заведующий отделом реального сектора и инфраструктуры;
2013-2016 гг. - ЗАО «СУ-12», Председатель Правления;
2016-2018 гг. - ЗАО «Аллор Строй Сервис», Генеральный директор;
С 13 марта 2018 года - Жогорку Кенеш Кыргызской Республики, депутат VI созыва от политической партии «Республика – Ата Журт».
В ноябре 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии "Ынтымак". Лидер фракции. 
Награды:
- Отличник «Социального работника»;
- Отличник «финансово-экономического работника»;
- Отличник «торгово-экономического работника»;
- Награжден именными часами Премьер-министром КР;
- Почетная грамота Правительства КР.
Кандидат в мастера спорта по самбо.
Воспитывает четверых детей.

Родился 14 марта 1976 года в  г. Майлуу-Суу Жалал-Абадской области.
Имеет высшее образование. В 1993 году поступил в Кыргызский национальный университет им. Ж. Баласагына, юридический факультет.
Трудовая деятельность:
В 2000 году начал работу прокурором в отделе по надзору за исполнением законов и законностью правовых актов прокуратуры Баткенской области;
В 2001-2002 годы работал прокурором в отделе по надзору за соответствием судебных постановлений законам в прокуратуре Жалал-Абадской области;
В 2002-2004 годы являлся старшим следователем Жалал-Абадской городской прокуратуры;
В 2004-2005 годы стал помощником прокурора Чаткальской районной прокуратуры;
В 2005-2006 годы – Управление организационного обеспечения и международных связей Генеральной прокуратуры КР, прокурор отдела;
С апреля по декабрь 2006 года – заместитель прокурора Иссыкатинского района Чуйской области;
В 2006-2007 годы был заместителем прокурора Сузакского района Жалал-Абадской области;
С 2007 по 2009 годы работал прокурором Тогуз-Тороуского района Жалал-Абадской области;
В 2010 году был избран депутатом Жогорку Кенеша Кыргызской Республики V созыва от политической партии «Ата-Журт»;
В 2015 году был избран депутатом Жогорку Кенеша Кыргызской Республики VI созыва от политической партии «Республика-Ата Журт»;
4 ноября 2020 года избран на пост Торага Жогорку Кенеша Кыргызской Республики;
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ынтымак»;
29 декабря 2021 года избран на пост Торага Жогорку Кенеша Кыргызской Республики;
Женат, отец четверых детей.

Родился 9 марта 1965 года в селе Куршаб Узгенского района Ошской области.
В 1982 году окончил среднюю школу в селе Куршаб.
1983-1985 гг. — служил в Германии в рядах Советской Армии.
1985–1987 гг. — возглавлял комсомольский строительный отряд «Шумкар» в совхозе «Кайнар» Узгенского района Ошской области.
В 1987-1992 гг. окончил Тверской государственный университет по специальности "Историк, преподаватель истории и обществоведения",
В 1999 году получил образование в Кыргызском государственном национальном университете по специальности "Юрист".
Трудовая деятельность:
1992 г. — референт министра печати и информации КР, главный редактор газеты "Турк ааламы";
1992–1995 гг.— главный редактор детских и молодежных программ Государственной национальной телерадиокомпании (ГТРК);
1995–2000 гг. — депутат Законодательной палаты Жогорку Кенеша Кыргызской Республики I созыва. Председатель Комитета по социальной политике, занятости и СМИ;
2000-2005 гг. — депутат Законодательной палаты Жогорку Кенеша КР II созыва. Председатель Комитета по труду, социальной политики и ветеранов;
2005-2006 гг. — депутат Жогорку Кенеша III созыва;
2006 г. — вице премьер-министр Кыргызской Республики;
2006 г. — председатель политической партии «Бүтүн Кыргызстан»;
2006–2007гг. — государственный секретарь Кыргызской Республики;
2007–2008 гг.— депутат Жогорку Кенеша Кыргызской Республики IV созыва. Спикер Жогорку Кенеша Кыргызской Республики;
2008–2009 гг.— секретарь Совета безопасности Кыргызской Республики;
2013–2015 гг.— заместитель генерального секретаря Совета сотрудничества тюркоязычных государств;
С ноября 2021 года — депутат Жогорку Кенеша VII  созыва, лидер парламентской  фракции "Бүтүн Кыргызстан".
Женат, отец троих детей.

Родился в 1981 году в городке Шамалды-Сай Жалал-Абадской области.
В 1998 году окончил Шамалды-Сайскую школу № 2 имени К.Осмонкулова.
Образование высшее. В 2003 году окончил Жалал-Абадский коммерческий институт по специальности "Экономист".
Трудовой путь начал в 2003 году в многоотраслевом производственном сельскохозяйственном кооперативе «Азиз КД».
В 2007 году работал экспертом в кредитном отделе Жалал-Абадского филиала «Инэксимбанка»;
В 2008 году - руководитель сберегательной кассы Шамалды-Сай №42 «БТА банка»;
В 2013 году избран депутатом айыльного кенеша;
В 2016 году повторно избран депутатом айыльного кенеша;
С 24 декабря 2013 года - руководитель айыл окмоту Достук;
В 2016 году депутатами местного кенеша единогласно переизбран главой айыл окмоту на второй срок.
За плодотворный труд на благо народа был награжден следующими наградами:
В 2015 году признан газетами Эркин Тоо и «Кыргыз Туусу» «Лучшим айыл окмоту года», в 2016 году награжден нагрудным знаком «Отличник сельского хозяйства», в 2016 году газетой «Ноокен жаӊырыгы» признан «Лучшим айыл окмоту 2016 года», в 2016 году по итогам года награжден Переходящим Красным знаменем Ноокенского района как «Лучший айыл окмоту года», газетой «Кыргыз Туусу» признан «Лучшим айыл окмоту 2017 года», в 2017 году по итогам года награжден Переходящим Красным знаменем Ноокенского района как «Лучший айыл окмоту года», в 2017 году от Государственного агентства по делам местного самоуправления и межэтническим отношениям при Правительстве КР получил «Благодарственное письмо», газетами «Эркин Тоо» и Аймак» признан «Лучшим айыл окмоту 2017 года», в 2017 году Министерством сельского хозяйства и мелиорации КР награжден нагрудным знаком «Сельскому хозяйству 90 лет», в 2017 году газетой «Кыргыз Туусу» признан «Лучшим айыл окмоту 2017 года» и награжден нагрудным знаком «Кыргыз Туусунун каарманы», в 2017 году стал победителем конкурса газеты «Ноокен жаӊырыгы» «Лучший айыл окмоту 2017 года», в 2018 году общественным объединением «КР Ардактуу инсандары» присвоено звание и вручен нагрудной знак «Эл сүйгон жетекчи», в 2018 году Государственным агентством по делам местного самоуправления и межэтническим отношениям награжден нагрудным знаком «Отличник местного самоуправления Кыргызской Республики”, в 2019 году айыл окмоту Достук стал победителем общегосударственного конкурса “Самый лучший айыл окмоту”, премия 1500000, в 2019 году газета “Кыргыз Туусу” признала их “Лучшим айыл окмоту года”, газета “Ачык сөз” признала его “Выдающимся главой айыл окмоту”, в 2019 году газета “Эркин Тоо” признала их “Лучшим айыл окмоту года”, объединение юридических лиц “Ассоцияция общественных объединений Кыргыз Республикасынын Даанышмандар жана жигердүүлөрдү колдо” (поддержка умудренных опытом и доблесных Кыргызской Республики) вручила ему нагрудной знак “Эл сүйгөн жетекчи”, в 2020 году журнал “Жетиген” признал “Лучший айыл окмоту года 2020 года”.
В 2021 году избран депутатом Жогорку Кенеша Кыргызской Республики от политической партии “Ыйман нуру”.
Семейный, воспитывает 3 сыновей и дочь.

Родился 18 июля 1970 года в селе Исфана Лейлекского района.
Образование:

В 1993 году - окончил Московский государственный технический университет имени Н.Э. Баумана по специальности «инженер-механик»;
В 2010 году - окончил Академию управления при президенте Кыргызской Республики по специальности «менеджмент государственного управления».

Трудовая деятельность:

1994 год - генеральный директор кыргызско-казахского СП «Трио-Б»;
2000-2001 годы - директор имущественного комплекса АК «Кыргыз-Дан-Азык»;
2001-2005 годы - генеральный директор компании «Кыргыз-Дан»;
2005 год - советник министра финансов Кыргызской Республики;
2005-2007 годы - вице-президент ОАО «Международный аэропорт «Манас» по социально-экономическим вопросам;
2007-2008 годы - председатель Ассоциации Аэропортов СНГ Межгосударственного авиационного комитета;
2007-2010 годы - президент ОАО «Международный аэропорт «Манас»;
2011-2015 годы - председатель Совета директоров ЗАО «Группа компаний АККА»;
2015-2020 годы - депутат Жогорку Кенеша Кыргызской Республики VI созыва от политической партии «Республика-Ата Журт»;
2015 год - член Комитета по транспорту, коммуникациям, архитектуре и строительству Жогорку Кенеша Кыргызской Республики;
2020-2021 годы - Председатель правления-Генеральный директор ОАО «Международный аэропорт «Манас»;
2021 год - советник Председателя Правления ЗАО «Группа компаний АККА»;
29 декабря 2021 года был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва  от №16 Ноокенского избирательного округа;
12 января 2022 года был избран Председателем Комитета по транспорту, коммуникациям, архитектуре и строительству Жогорку Кенеша Кыргызской Республики.

Семейное положение: Женат, отец четырех детей.
Награды:

Почетная грамота Кыргызской Республики за заслуги в развитии гражданской авиации;
Почетная грамота Жогорку Кенеша Кыргызской Республики.

Родился 21 марта 1972 года в с. Кен-Суу Тюпского района Иссык-Кульской области;
Имеет высшее образование.
В 1996 году поступил в Кыргызский Национальный Университет им. Ж.Баласагына по специальности “Юриспруденция”;
2011-2014 годы учился в Дипломатической Академии Министерства Иностранных дел Кыргызской Республики им. К. Дикамбаева по направлению “Международные отношения”;
Свою трудовую деятельность начал в 1992 году рядовым сотрудником в Проектно-оформительном кооперативе «Дизайн»;
1992-1994 годы находился на службе в органах внутренних дел Министерства внутренних дел Кыргызской Республики;
1995-1999 годы работал рядовым сотрудником в Государственной налоговой инспекции при Министерстве финансов Кыргызской Республики;
1999-2002 годы был оперуполномоченным в Государственной налоговой инспекции при Министерстве финансов Кыргызской Республики;
2002-2003 годы являлся оперуполномоченным межрайонного отдела финансовой полиции по Чуйской и Кеминскому районам Межрегионального управления финансовой полиции при Правительстве Кыргызской Республики;
2005-2008 годы находился на службе в органах финансовой полиции при Правительстве Кыргызской Республики;
2009-2012 годы находился на службе в органах финансовой полиции при Правительстве Кыргызской Республики;
2016-2021 был аудитором Счетной оплаты Кыргызской Республики;
В ноябре 2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва по Ак-Суйскому одномандатному округу №35.
Женат, отец четверых детей.
Награды:
Грамота Государственной налоговой инспекции за высокие показатели в работе (1998 год).
Нагрудные знаки: “Шаң” (2006 год), “Лучший работник” (2007 год), “Күжүрмөн” (2009 год), “Мекенчил” (2009 год), “Отличник государственного аудита” (2018 год).
Медали: “Образцовый сотрудник третьей степени Счетной палаты Кыргызской Республики” (2020 год), “Образцовый сотрудник первой степени Счетной палаты Кыргызской Республики” (2021 год).

Родился 15 сентября 1977 года в селе Көк-Ой Таласского района Таласской области.
В 1995 году окончил Бишкекский автомобильно-дорожный колледж, в 1998-м — Кыргызский государственный университет строительства, транспорта и архитектуры по специальности “инженер-строитель”.
В 2002 году окончил Бишкекский гуманитарный университет имени К.Карасаева по специальности "мировая экономика".
Трудовая деятельность:

1997-2014 гг. — индивидуальный предприниматель;
2014-2017 гг. — председатель ассоциации обменных бюро Кыргызской Республики "Альянс";
2017-2020 гг. — председатель общественного объединения                 "Арча-Бешик конушу";
2021-п.н.в. – депутат VII созыва Жогорку Кенеша Кыргызской Республики.

Женат, отец троих детей.

Родился 3 июля 1985 года в селе Ала-Бука Ала-Букинского района Джалал-Абадской области;
В 2002 году окончил Кыргызско-Турецкий лицей имени Ч.Айтматова;
В 2007 году окончил Кыргызско-Российский Славянский университет им. Б. Н. Ельцина,  Факультет международных отношений - «Мировая экономика»;
В 2011 году окончил магистратуру по направлению "юриспруденция" Кыргызской государственной юридической академии.;
В 2007-2008 годы экономист отдела внешних связей ОАО "Электрические станции";
В 2008-2010 годы Оперативно-уполномоченный сотрудник в  Государственной службе финансовой полиции;
В 2010-2011 годы советник спикера Жогорку Кенеша Кыргызской Республики.;
В 2011-2012 годы заместитель директора департамента регистрации населения и актов гражданского состояния при Государственной регистрационной службы  КР;
С 2016 года  основатель и генеральный директор ОсОО "Кыргыз-Чех суу компаниясы";
В июле 2021 года был избран депутатом городского Кенеша города  Ош от политической партии “ Ата-Журт Кыргызстан”;
В ноябре 2021 года был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии « Ата-Журт Кыргызстан »;
С 13 января 2022 года заместитель председателя Комитета Жогорку Кенеша по транспорту, коммуникациям, архитектуре и строительству;
Женат, отец троих детей.

Родился 16 сентября 1976 года в селе Барпы Сузакского района Джалал-Абадской области.
Имеет высшее образование.
 В 1997 году окончил Джалал-Абадский коммерческий институт по специальности "коммерческая деятельность", в 2000 году стал магистром бизнес-управления Академии управления при президенте КР, в 2011 году окончил Московскую таможенную академию.
В 2000 году начал работать ведущим специалистом международного отдела Джалал-Абадского Государственного Университета;
  2001 — ведущий специалист Октябрьского администрации города      Бишкек;
  2001-2003 — ведущий специалист, главный специалист Государственной   комиссии по антимонопольной политике;
2003-2013 — инспектор, старший инспектор, главный инспектор,      начальник поста, замглавы Джалал-Абадской таможник;
С 2015 - 2021 — Директор ОсОО "Джалал-Абадский   нефтеперерабатывающий завод";
С 2016  — 2020  - Депутат Джалал-Абадского городского кенеша
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от Жалал-Абадского одномандатного округа №14
Женат воспитывает шестерых детей.

Родился 23 ноября 1973 года в с.Кош-Терек, Ала-Букинского района, Жалал-Абадской области, по национальности - кыргыз.  
Имеет два высших образования:
1992-1997 г.г. обучение в Военной Академии ПВО Сухопутных войск РФ, окончил с отличием.
1997 – 2013 - в различных оперативных и руководящих должностях ОНБ КР;
2009-2010 - Заместитель Начальника Управления ССБ Финансовой полиции КР;
2013-2014 - Директор филиала «Газпром нефть Азия»;
2013-2015 г.г. Ошский государственный университет по специальности «Юриспруденция»;
2014-2015 - Директор департамента по обеспечению и перспективного развития ОАО «НЭСК»;
2015-2019 - Начальник Управления Внутренней безопасности и противодействия коррупции ГТС при ПКР;
2019-07.2019 - Начальник Главного Управления ГКНБ КР;
29.11.2021 года избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Бутун Кыргызстан». 
Женат, воспитывает троих детей.

Родился 7 сентября 1979 года в селе М.Баетово Ак-Талинского района Нарынской области.
Имеет высшее образование.
В 2001-м окончил Кыргызский технический университет имени И. Раззакова по специальности "инженер-энергетик". В 2018-м получил диплом юриста в Кыргызской государственной юридической академии.
Трудовая деятельность:
2001г.-2002г. – Коммунальное предприятие ОсОО «ЖЭУ №12» -  мастер по производству;  
2002г.-2003г. – Коммунальное предприятие ОсОО «ЖЭУ №4» -  мастер по производству;  
2003г.-2006г. – Строительная фирма ОсОО «Чындоо» -  инженер, главный инженер;  
2006г.-2008г. – Компания ОсОО «Интер Альянс» - главный энергетик;
2008г.-2011г. – Строительная компания «Профит Экспресс» - технический директор;     
2011г.- 2021г.- Строительная компания «МС Билдинг» - генеральный директор;  
 Награды:
Почетная грамота Жогорку Кенеша - 2018г.;
Почетная грамота Аппарата Правительства КР -2020г.;
Почетная грамота Полномочного Представителя ПКР в Нарынской области – 2018г.;
Почетная грамота ГААС и ЖКХ при Правительстве КР – 2019г.;
Почетная грамота ДЖГС ГААС и ЖКХ при Правительстве КР – 2018г.;
Почетная грамота Академии Управления при Президенте КР – 2012г.
Почетная грамота Мэра г. Бишкек -2011г.;
Почетная грамота Мэра г. Бишкек -2016г.;
Почетная грамота Мэра г. Бишкек -2017г.;
Почетная грамота УКС мэрии г. Бишкек -2013г.;
Почетная грамота УВД Нарынской области  -2021г.;
Почетный гражданин Нарынской области;
В 2021 году был избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от политической партии «Ынтымак».
Заместитель председателя Комитета по транспорту, коммуникациям, архитектуре и строительству;
Женат, отец четверых детей.

Родился 21 сентября 1972 года в Иссык-Кульской области. Работал на различных должностях на государственной и муниципальной службах, а также в частном секторе.
 Образование:

1992 — окончил ветеринарный факультет Кыргызского сельскохозяйственного института имени К. И. Скрябина;
1997 — окончил факультет лесного хозяйства по специальности "инженер лесного хозяйства" в Стамбульском университете (Стамбул, Турция);
2001 — окончил учебу на отделении агроэкологии в Кыргызском аграрном университете имени К. И. Скрябина, получил степень бакалавра по специальности "инженер-эколог";
2009 — окончил учебу на отделении менеджмента в Академии управления при президенте Кыргызстана (бакалавриат).

Трудовая деятельность:

1996-1997 — работал в отделе стран СНГ франко-турецкой страховой компании "Корис интернейшнл" в Стамбуле;
1997-2000 — помощник директора Государственного агентства лесного хозяйства;
2000-2004 — помощник депутата Жогорку Кенеша, старший консультант в Комитете по развитию промышленности и бизнеса ЖК КР;
2004-2010 — советник, помощник, заведующий отделом, заместитель и первый заместитель управляющего делами президента;
2010-2013 — политический обозреватель, заместитель главного редактора, главный редактор газеты "Айат";
2013-2015 — советник президента корпорации "Аю Холдинг";
2015-2018 — член совета директоров, вице-президент этой же компании;
2018-2020 — руководитель аппарата мэрии Бишкека.
В июле 2020 года назначен полномочным представителем  правительства в Иссык-Кульской области.
В октябре 2020 года назначен исполняющим обязанности мэра Бишкека.
2021 – Депутат Жогорку Кенеша Кыргызской Республики

Родился 13.05.1977 году в с. Кара-Жыгач Аксыйского района Джалал-Абадской области Кыргызской Республики
Образование высшее, окончил в 1999 году – Кыргызскую аграрную академию им. К.И. Скрябина, факультет - экономики и агробизнеса.
Трудовая деятельность:
1996-1997 г.г. – заместитель главного редактора, главный редактор газеты «Обон»;
1997-1999 г.г. – главный редактор газеты «Учкун»;
1999-2004 г.г.. – первый заместитель главного редактора газеты «Эркин-Тоо»;
2004-2004 г.г. – пресс-секретарь Министерства Транспорта и коммуникаций Кыргызской Республики;
2005-2006 г.г. – главный редактор газеты «Эркин-Тоо»;
2006-2009 г.г. – пресс-секретарь Президента Кыргызской Республики;
2009-2010 г.г. – генеральный директор «Общественного телерадиокомпания – «ЭлТР»;
2010-2011 г.г. - министр Культуры и информации Кыргызской Республики;
2012-2014 г.г.  – советник лидера фракции "Ата-Журт" Жогорку Кенеша Кыргызской Республики;
2017-2021 г.г.  – главный директор телеканала «2 канал» (New TV);
2021-г. – избран депутатом Жогорку Кенеша Кыргызской Республики VII созыва от Аксыйского избирательного округа № 17.
Государственный советник 2-класса государственной службы.
Награды:
Почетная грамота исполнительного комитета Содружество Независимых Государств (СНГ);
Юбилейная медаль Шанхайской Организации Сотрудничества (ШОС) и другими ведомственными наградами
